module.exports = {
  name: 'reply',
  description: 'Send back the media URL from a replied message',
  async execute({ api, event }) {
    const reply = event.messageReply;

    if (!reply || !reply.attachments || reply.attachments.length === 0) {
      return api.sendMessageMqtt("‚ùå No media found in the replied message.", event.threadID, event.messageID);
    }

    // üîç Debug log the attachments
    console.log("[DEBUG] Attachments from messageReply:\n", JSON.stringify(reply.attachments, null, 2));

    const urls = reply.attachments.map(att => {

      return att.url || att.largePreviewUrl || att.previewUrl || att.thumbnailUrl || null;
    }).filter(Boolean); // remove null or undefined

    if (urls.length === 0) {
      return api.sendMessageMqtt("‚ùå No usable URL found in the media.", event.threadID, event.messageID);
    }

    await api.sendMessageMqtt(urls.join("\n"), event.threadID, event.messageID);
    api.setMessageReactionMqtt("‚úÖ", event.messageID, event.threadID);
  }
};

